import { 
    Flex,
    Heading
} from '@chakra-ui/react';

const Logo = () => {
    return (
        <Flex
            alignItems="center"
            gap="0.5rem"
            bgColor="#ff8177"
            bgImage="linear-gradient(to top, #ff0844 0%, #ffb199 100%)"
            bgSize="100%"
            css={{
                '-webkit-background-clip': 'text',
                '-webkit-text-fill-color': 'transparent'
            }}
            fontSize={["1rem", "1.5rem"]}
        >
            <i class="fa-solid fa-hammer fa-fw" />
            <Heading size={['md', 'md', 'md', 'lg']}>
                Breakdown
            </Heading>
        </Flex>
    );
}

export default Logo;
